import React from "react";

const ContactUs = () => {
  return (
    <section className="min-h-screen py-16 px-8 bg-black text-white">
      <div className="max-w-5xl mx-auto text-center">
        <h1 className="text-5xl font-extrabold text-yellow-400 mb-8">Contact Us</h1>
        <p className="text-gray-300 text-lg max-w-3xl mx-auto">
          Have questions or need assistance? Our team is here to help. Reach out to us anytime.
        </p>

        <div className="mt-12 flex flex-col md:flex-row items-center justify-center space-y-8 md:space-x-12">
          <div className="p-6 bg-gray-900 rounded-lg shadow-lg max-w-sm">
            <h3 className="text-2xl font-bold text-yellow-300">üìß Email</h3>
            <p className="text-gray-400 mt-2">support@astratax.ai</p>
          </div>
          <div className="p-6 bg-gray-900 rounded-lg shadow-lg max-w-sm">
            <h3 className="text-2xl font-bold text-yellow-300">üìç Office</h3>
            <p className="text-gray-400 mt-2">IIT Mandi, Himachal Pradesh</p>
          </div>
        </div>
      </div>
    </section>
  );
};

export default ContactUs;
